(81, '84', '2014-08-23', '2014-08-24', '2014-06-13', 'YYL', 'County London (Testing)', NULL, 'London ', 'Single Room - With Breakfast <br>', 1, 'Upper Woburn Place', 1, '0000-00-00', '0000-00-00', 'Non-Refundable Rate - No amendment permitted.', 1, '1', '0', 'This 1-star budget-style hotel is located in the city centre in Bloomsbury area near Kings Cross and Euston train stations and the British Museum. Very basic accommodation suitable for less-demanding travellers on low budget. Good value regarding its central location.<br>The hotel is centrally situated in Bloomsbury area near major train stations Euston (5-min walk) and Kings Cross (10-min walk). There are many tube stations in the proximity giving access to several tube lines. Russell Square or Kings Cross tube stations on Piccadilly line have direct connections to Heathrow Airport. Kings Cross station also has train connections to Luton and Gatwick Airports. The main shopping area â€“ Oxford Street â€“ is only 20-min walk from the hotel. Nearest tourist attraction is the British Museum about 10-min walk away.<br>The property is a 7-storey modern red-brick building.<br><br><br>Rooms are small in size. They are very basically equipped with plain furniture and quite dated decor; however they have modern amenities including TV, radio and coffee/tea making facilities. Some rooms have bunk beds. Bathrooms are shared among every four rooms. However, there is a wash basin in every room.<br>The hotel bar serves drinks as well as light meals. Buffet breakfast is served in the basement breakfast room.<br><br>Parking is available 5-min walk from the hotel in a sister hotel Royal National.\nPlease note that children must share a private room (single/double/triple) with their parents/guardian. They cannot be accommodated in the dormitories.', '', '', '0044 (0)2073875544', '0044 (0)2078374653', '1', 'travco', '', '', '', 'Two Bedsd, Smoking Room, Except Ground Floor', ' hotel does not guarantee requests like thes', 0),
