(103, '106', '2015-05-08', '2015-05-09', '2014-06-30', '157077', 'Karon Cliff Contemporary Boutique Bungalows', NULL, 'Phuket', 'DOUBLE SUPERIOR SEAVIEW-ROOM ONLY <br>', 3, 'PATAK RD, KARON, MUANG 691/1', 2, '2015-04-30', '0000-00-00', 'Cancellation Deadline: 2015-04-28(12 noon IST) After deadline 100% price of room booking cost', 1, '2-2', '1-1', 'This city hotel comprises a total of 27 simple and spacious rooms. Guests are welcomed in the lobby, which offers a 24-hour reception, as well as a hotel safe, a business centre and a library. It features a range of facilities assuring a comfortable stay to its guests, such as free wireless Internet access, 24-hour room service and a laundry service. Bicycle hire is available, and those arriving by car may leave their vehicles in the hotel car park.', '-Children who are under 2 years of age will not be charged for sharing the same room as the parents subject to the existing bedding arrangement.', 'Payable through HOTELBEDS (THAILAND) LTD, acting as agent for the service operating company, details of which can be provided upon request. VAT: 3101417579 Reference: 321-1133918', '006676286247', '006676286246', '1', 'hotelsbed', 'CONTRACT', '-Children who are under 2 years of age will not be charged for sharing the same room as the parents subject to the existing bedding arrangement.', '5, 1, ', 'Two Bedsd, Late Arrival, Except Ground Floor, Cot', 'te that hotel does not guarantee requests like', 0),
(104, '107', '2014-11-18', '2014-11-19', '2014-07-28', '133856', 'Palmers Lodge - HSD', NULL, 'London', 'BED IN SHARED ROOM 18 BEDS ROOM-CONTINENTAL BREAKFAST <br>', 0, 'COLLEGE CRESCENT 40', 1, '2014-11-17', '0000-00-00', 'Cancellation Deadline: 2014-11-15(12 noon IST) After deadline 100% price of room booking cost', 1, '1', '0', 'This unique new central London hostel is housed in a Victorian listed building that received a substantial refurbishment to restore it to original condition. It offers international travellers all the facilities expected at the very best hostels in London. The hostel offers 35 guest rooms in total, and facilities include a lobby with hotel safe, lift access, a newspaper stand, TV lounge, bar and disco. Guests may also take advantage of the WLAN Internet access, a laundry service and a car park (fees apply).', 'Please note that PHOTO I.D. is required at check in. Under 18s must be accompanied by an over 18 adult booked into the same private room. Written authorization signed by their parents and copies of parents ID\\''s are needed.\nFor Group Bookings of over 15 persons you will need to contact the groups department directly, to make sure that we allocate as many of you in the same room(s).\n																			\n																			\n																			\n', 'Payable through HOTELBEDS UK LIMITED, acting as agent for the service operating company, details of which can be provided upon request. VAT: 234328478', '00442074838470', '00442074838471', '1', 'hotelsbed', 'CONTRACT', 'Please note that PHOTO I.D. is required at check in. Under 18s must be accompanied by an over 18 adult booked into the same private room. Written authorization signed by their parents and copies of parents ID''s are needed.\nFor Group Bookings of over 15 persons you will need to contact the groups department directly, to make sure that we allocate as many of you in the same room(s).\n																			\n																			\n																			\n', '', 'Double Bed, Late Arrival, Ground Floor, Rooms For Disabled Guests', 'We will send all your request to the hotel, but please note that hotel does not guarantee requests like these. For more information, please contact the establishment directly', 0);
